INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- startDate: 开始时间；endDate：结束时间  格式：\'YYYY-MM-DD\'-->\r\nSELECT cms_category.id,cms_category.category_title as category ,\r\n       manager.manager_name as managers,\r\n       count(cms_content.content_title) as num\r\nFROM cms_content LEFT JOIN cms_category\r\nON cms_content.category_id = cms_category.id LEFT JOIN manager ON cms_content.create_by = manager.id\r\nWHERE cms_content.del = 0 and progress_status not like CONCAT(\'%\',\'不通过\') and   cms_content.CREATE_DATE between  DATE_FORMAT(\'${startDate}\',\'%Y-%m-%d\') and DATE_FORMAT(\'${endDate}\',\'%Y-%m-%d\')\r\nGROUP BY cms_category.id,cms_category.category_title,manager.manager_name','system',null,'按管理员统计',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '    <#-- day: today为今天数据,yesterday为昨天数据,不传为总数据 -->\r\nSELECT COUNT(0) as \'num\' FROM `access_statistics`\r\n    <#if day??>\r\n	<#if day==\'today\'>\r\nWHERE TO_DAYS( NOW( ) ) = TO_DAYS(create_date)\r\n    <#elseif day==\'yesterday\'>\r\nWHERE TO_DAYS( NOW( ) ) - TO_DAYS(create_date) = 1\r\n    </#if>\r\n    </#if>','system',null,'网站访问量',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: today为今天数据,yesterday为昨天数据,不传为总数据 -->\r\nSELECT\r\n	COUNT( 0 ) AS num \r\nFROM\r\n	( SELECT COUNT( 0 ) FROM `access_statistics`\r\n		<#if day??>\r\n			<#if day==\'today\'>\r\n			WHERE TO_DAYS( NOW( ) ) = TO_DAYS(create_date)\r\n			<#elseif day==\'yesterday\'>\r\n			WHERE TO_DAYS( NOW( ) ) - TO_DAYS(create_date) = 1\r\n			</#if>\r\n		</#if>\r\n	 GROUP BY `cookie` ) AS cookie','system',null,'网站访客数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: today为今天新增,yesterday为昨天新增 -->\r\nSELECT\r\n	COUNT( 0 ) AS \'newUser\' \r\nFROM\r\n	(\r\n	SELECT DISTINCT\r\n		ip \r\n	FROM\r\n		`access_statistics` \r\n	<#if day??>\r\n	WHERE\r\n		<#if day==\'today\'>\r\n		TO_DAYS( NOW( ) ) = TO_DAYS(create_date)\r\n		<#elseif day==\'yesterday\'>\r\n		TO_DAYS( NOW( ) ) - TO_DAYS( create_date ) = 1 \r\n		</#if>\r\n	</#if>\r\n		\r\n		AND ip NOT IN ( SELECT DISTINCT ip FROM `access_statistics`\r\n		<#if day??>\r\n		WHERE \r\n			<#if day==\'today\'>\r\n			TO_DAYS( NOW( ) ) != TO_DAYS(create_date)\r\n			<#elseif day==\'yesterday\'>\r\n			TO_DAYS( NOW( ) ) - TO_DAYS( create_date ) > 1 \r\n			</#if>\r\n		</#if>\r\n		) \r\n	) AS ip','system',null,'网站新增IP数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- time: 指定日期,格式 : yyyy-MM-dd  -->\r\n<#-- days: 天数 格式:整数  -->\r\nSELECT\r\n    t1.`day` AS `day`,\r\n    COUNT(t2.id) AS num\r\nFROM\r\n    (SELECT\r\n         @cdate := DATE_ADD(@cdate, INTERVAL - 1 DAY) DAY\r\n     FROM\r\n         (SELECT\r\n         @cdate := DATE_ADD(\'${time}\', INTERVAL + 1 DAY)\r\n         FROM\r\n         `access_statistics`) t0\r\n         LIMIT  ${days}) t1\r\n        LEFT JOIN\r\n    ( SELECT *,DATE_FORMAT( create_date, \"%Y-%m-%d\" ) AS DAY  FROM `access_statistics`  WHERE create_date > DATE_ADD(\'${time}\', INTERVAL - ${days} DAY) AND create_date < DATE_ADD(\'${time}\', INTERVAL +1 DAY)\r\n    ) t2\r\n    ON t2.day = t1.day\r\nGROUP BY t1.`day`;\r\n','system',null,'指定时间前N天内每天访问量',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- time: 指定日期,格式 : yyyy-MM-dd --> <#-- days: 天数 格式:整数 -->\r\nSELECT t1.day AS `day`,\r\n       COUNT( t2.id ) num\r\nFROM\r\n    (SELECT @cdate := DATE_ADD( @cdate, INTERVAL - 1 DAY ) DAY\r\n     FROM\r\n         (SELECT @cdate := DATE_ADD(  \'${time}\', INTERVAL + 1 DAY )\r\n         FROM access_statistics ) t0 LIMIT ${days}) t1\r\n        LEFT JOIN\r\n    (SELECT *,\r\n            DATE_FORMAT( create_date,\r\n                         \'%Y-%m-%d\' ) AS DAY\r\n     FROM\r\n         (SELECT any_value(id) id, any_value(create_date) create_date\r\n         FROM access_statistics\r\n         WHERE create_date > DATE_ADD( \'${time}\', INTERVAL - ${days} DAY )\r\n         AND create_date < DATE_ADD( \'${time}\', INTERVAL + 1 DAY )\r\n         GROUP BY  DATE_FORMAT( create_date, \'%Y-%m-%d\' ),IP ) AS ip ) t2\r\n    ON t2.DAY = t1.DAY\r\nGROUP BY  t1.day;','system',null,'指定时间前N天内每天IP数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- time: 指定日期,格式 : yyyy-MM-dd  -->\r\n<#-- days: 天数 格式:整数  -->\r\nSELECT\r\n    t1.`day` AS `day`,\r\n    COUNT(t2.id) AS num\r\nFROM\r\n    (SELECT\r\n         @cdate := DATE_ADD(@cdate, INTERVAL - 1 DAY) DAY\r\n     FROM\r\n         (SELECT\r\n         @cdate := DATE_ADD(\'${time}\', INTERVAL + 1 DAY)\r\n         FROM\r\n         `access_statistics`) t0\r\n         LIMIT ${days}) t1\r\n        LEFT JOIN\r\n    (\r\n        SELECT *,DATE_FORMAT( create_date, \"%Y-%m-%d\" ) AS DAY\r\n        FROM ( SELECT any_value(id) id, any_value(ip) ip, any_value(create_date) create_date FROM `access_statistics`\r\n            WHERE create_date > DATE_ADD(\'${time}\', INTERVAL - ${days} DAY)\r\n            AND create_date < DATE_ADD(\'${time}\', INTERVAL +1 DAY)\r\n            AND ip NOT IN(\r\n            SELECT DISTINCT ip\r\n            FROM `access_statistics`\r\n            WHERE create_date < DATE_ADD(\'${time}\', INTERVAL - ${days} DAY)  GROUP BY ip\r\n            ) ) AS two GROUP BY `IP`\r\n    ) t2\r\n    ON t2.day = t1.day\r\nGROUP BY t1.`day`;','system',null,'指定时间前N天内每天新增ip数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- time: 指定日期,格式 : yyyy-MM-dd  -->\r\n<#-- days: 天数 格式:整数  -->\r\nSELECT\r\n  t1.`day` AS `day`,\r\n  FORMAT(AVG( t2.access_time ),2) AS num\r\nFROM\r\n  (SELECT\r\n    @cdate := DATE_ADD(@cdate, INTERVAL - 1 DAY) DAY\r\n  FROM\r\n    (SELECT\r\n      @cdate := DATE_ADD(\'${time}\', INTERVAL + 1 DAY)\r\n    FROM\r\n      `access_statistics`) t0\r\n  LIMIT ${days}) t1\r\n  LEFT JOIN\r\n    (  \r\nSELECT * ,DATE_FORMAT( create_date, \"%Y-%m-%d\" ) AS DAY \r\nFROM `access_statistics` \r\nWHERE  create_date > DATE_ADD(\'${time}\', INTERVAL - ${days} DAY) \r\nAND create_date < DATE_ADD(\'${time}\', INTERVAL +1 DAY) 	\r\n ) t2\r\n    ON t2.day = t1.day\r\nGROUP BY t1.`day`;','system',null,'指定时间前N天内每天的平均访问时长',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- time: 指定日期,格式 : yyyy-MM-dd  -->\r\n<#-- days: 天数 格式:整数  -->\r\n<#-- deviceType: 设备类型 格式: pc 或 phone  -->\r\nSELECT\r\n    t1.`day` AS `day`,\r\n    COUNT(t2.id) AS num\r\nFROM\r\n    (SELECT\r\n         @cdate := DATE_ADD(@cdate, INTERVAL - 1 DAY) DAY\r\n     FROM\r\n         (SELECT\r\n         @cdate := DATE_ADD(\'${time}\', INTERVAL + 1 DAY)\r\n         FROM\r\n         `access_statistics`) t0\r\n         LIMIT ${days}) t1\r\n        LEFT JOIN\r\n    (  SELECT *,DATE_FORMAT( create_date, \"%Y-%m-%d\" ) AS DAY\r\n       FROM (SELECT any_value(id) id, any_value(create_date) create_date FROM `access_statistics` WHERE `DEVICE_TYPE` = \'${deviceType}\' AND create_date > DATE_ADD(\'${time}\', INTERVAL - ${days} DAY) AND create_date < DATE_ADD(\'${time}\', INTERVAL +1 DAY) GROUP BY DATE_FORMAT( create_date, \'%Y-%m-%d\' ),`IP`) AS ip) t2\r\n    ON t2.day = t1.day\r\nGROUP BY t1.`day`;\r\n','system',null,'指定设备指定时间前N天内每天ip数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- time: 指定日期,格式 : yyyy-MM-dd  -->\r\n<#-- days: 天数 格式:整数  -->\r\n<#-- deviceType: 设备类型 格式: pc 或 phone  -->\r\nSELECT\r\n    t1.`day` AS `day`,\r\n    FORMAT(AVG( t2.access_time ),2) AS num\r\nFROM\r\n    (\r\n        SELECT\r\n            @cdate := DATE_ADD( @cdate, INTERVAL - 1 DAY ) DAY\r\n        FROM\r\n            ( SELECT @cdate := DATE_ADD( \'${time}\', INTERVAL + 1 DAY ) FROM `access_statistics` ) t0\r\n            LIMIT ${days}) t1\r\n        LEFT JOIN (\r\n        SELECT\r\n            *,\r\n            DATE_FORMAT( create_date, \"%Y-%m-%d\" ) AS DAY\r\n        FROM\r\n            `access_statistics`\r\n        WHERE\r\n            `DEVICE_TYPE` = \'${deviceType}\'\r\n          AND create_date > DATE_ADD( \'${time}\', INTERVAL - ${days} DAY )\r\n          AND create_date < DATE_ADD( \'${time}\', INTERVAL + 1 DAY )\r\n    ) t2 ON t2.DAY = t1.DAY\r\nGROUP BY\r\n    t1.`day`','system',null,'指定设备指定时间前N天内每天的平均访问时长',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: yesterday为昨天数据，日期为指定时间,不传为当天数据 -->\r\nSELECT\r\n    DATE_FORMAT( t1.`HOUR`, \'%H:00-%H:59\' ) AS `HOUR`,\r\n    DATE_FORMAT( t1.`HOUR`, \'%H\' ) AS `xAxis`,\r\n    COUNT( t2.id ) AS num\r\nFROM\r\n    (\r\n        SELECT\r\n            @cdate := DATE_ADD( @cdate, INTERVAL + 1 HOUR ) HOUR\r\n        FROM\r\n            ( SELECT\r\n                <#if day?? >\r\n                <#if day==\"yesterday\">\r\n            @cdate := DATE_ADD( DATE_FORMAT( CURDATE() - 1, \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR )\r\n                <#else>\r\n            @cdate := DATE_ADD( DATE_FORMAT( \'${day}\', \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR )\r\n                </#if>\r\n                <#else>\r\n            @cdate := DATE_ADD( DATE_FORMAT( CURDATE(), \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR )\r\n                </#if>\r\n\r\n            FROM `access_statistics` ) AS t0\r\n            LIMIT 24\r\n    ) t1\r\n        LEFT JOIN (\r\n        SELECT\r\n            *,\r\n            DATE_FORMAT( create_date, \"%Y-%m-%d %H:00:00\" ) AS HOUR\r\n        FROM\r\n            `access_statistics`\r\n        WHERE\r\n            <#if day?? >\r\n            <#if day==\'yesterday\'>\r\n            TO_DAYS( NOW( ) ) - TO_DAYS( create_date ) = 1\r\n            <#else>\r\n            TO_DAYS( \'${day}\' ) = TO_DAYS( create_date )\r\n            </#if>\r\n            <#else>\r\n            TO_DAYS( NOW( ) ) = TO_DAYS( create_date )\r\n            </#if>\r\n    ) t2 ON t2.HOUR = t1.HOUR\r\nGROUP BY\r\n    t1.`HOUR`;','system',null,'网站每小时访问量',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: yesterday为昨天数据，日期为指定时间,不传为当天数据 -->\r\nSELECT\r\n    DATE_FORMAT( t1.`HOUR`, \'%H:00-%H:59\' ) AS `HOUR`,\r\n    COUNT( t2.id ) AS num\r\nFROM\r\n    (\r\n        SELECT\r\n            @cdate := DATE_ADD( @cdate, INTERVAL + 1 HOUR ) HOUR\r\n        FROM\r\n            (\r\n            SELECT\r\n                <#if day?? >\r\n                <#if day==\"yesterday\">\r\n            @cdate := DATE_ADD( DATE_FORMAT( CURDATE() - 1, \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR ) <#else>\r\n            @cdate := DATE_ADD( DATE_FORMAT( \'${day}\', \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR ) </#if>\r\n                <#else>\r\n            @cdate := DATE_ADD( DATE_FORMAT( CURDATE(), \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR ) </#if>\r\n\r\n            FROM\r\n            `access_statistics`\r\n            ) AS t0\r\n            LIMIT 24\r\n    ) t1\r\n        LEFT JOIN (\r\n        SELECT\r\n            *,\r\n            DATE_FORMAT( create_date, \"%Y-%m-%d %H:00:00\" ) AS HOUR\r\n        FROM\r\n            (\r\n            SELECT\r\n            any_value(id) id, any_value(create_date) create_date\r\n            FROM\r\n            `access_statistics`\r\n            WHERE\r\n                <#if day?? >\r\n                <#if day==\'yesterday\'>\r\n            TO_DAYS( NOW( ) ) - TO_DAYS( create_date ) = 1 <#else>\r\n            TO_DAYS( \'${day}\' ) = TO_DAYS( create_date ) </#if>\r\n                <#else>\r\n            TO_DAYS( NOW( ) ) = TO_DAYS( create_date ) </#if>\r\n\r\n            GROUP BY\r\n            `IP`\r\n            ) AS ip\r\n    ) t2 ON t2.HOUR = t1.HOUR\r\nGROUP BY\r\n    t1.`HOUR`;','system',null,'网站每小时IP数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( 'SELECT\r\n  device_type AS name,\r\n  COUNT(id) AS value\r\nFROM\r\n   `access_statistics`\r\nGROUP BY device_type','system',null,'设备浏览量情况',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: today为今天新增,yesterday为昨天新增 -->\r\nSELECT\r\n	COUNT( 0 ) AS \'newUser\' \r\nFROM\r\n	(\r\n	SELECT DISTINCT\r\n		cookie \r\n	FROM\r\n		`access_statistics` \r\n	<#if day??>\r\n	WHERE\r\n		<#if day==\'today\'>\r\n		TO_DAYS( NOW( ) ) = TO_DAYS(create_date)\r\n		<#elseif day==\'yesterday\'>\r\n		TO_DAYS( NOW( ) ) - TO_DAYS( create_date ) = 1 \r\n		</#if>\r\n	</#if>\r\n		\r\n		AND cookie NOT IN ( SELECT DISTINCT cookie FROM `access_statistics`\r\n		<#if day??>\r\n		WHERE \r\n			<#if day==\'today\'>\r\n			TO_DAYS( NOW( ) ) != TO_DAYS(create_date)\r\n			<#elseif day==\'yesterday\'>\r\n			TO_DAYS( NOW( ) ) - TO_DAYS( create_date ) > 1 \r\n			</#if>\r\n		</#if>\r\n		) \r\n	) AS cookie','system',null,'今日新增访客数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: yesterday为昨天数据，日期为指定时间,不传为当天数据 -->\r\nSELECT\r\n    DATE_FORMAT( t1.`HOUR`, \'%H:00-%H:59\' ) AS `HOUR`,\r\n    COUNT( t2.id ) AS num\r\nFROM\r\n    (\r\n        SELECT\r\n            @cdate := DATE_ADD( @cdate, INTERVAL + 1 HOUR ) HOUR\r\n        FROM\r\n            (\r\n            SELECT\r\n                <#if day?? >\r\n                <#if day==\"yesterday\">\r\n            @cdate := DATE_ADD( DATE_FORMAT( CURDATE() - 1, \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR ) <#else>\r\n            @cdate := DATE_ADD( DATE_FORMAT( \'${day}\', \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR ) </#if>\r\n                <#else>\r\n            @cdate := DATE_ADD( DATE_FORMAT( CURDATE(), \'%Y-%m-%d %H:00\' ), INTERVAL - 1 HOUR ) </#if>\r\n\r\n            FROM\r\n            `access_statistics`\r\n            ) AS t0\r\n            LIMIT 24\r\n    ) t1\r\n        LEFT JOIN (\r\n        SELECT\r\n            *,\r\n            DATE_FORMAT( create_date, \"%Y-%m-%d %H:00:00\" ) AS HOUR\r\n        FROM\r\n            (\r\n            SELECT\r\n            any_value(id) id, any_value(create_date) create_date\r\n            FROM\r\n            `access_statistics`\r\n            WHERE\r\n                <#if day?? >\r\n                <#if day==\'yesterday\'>\r\n            TO_DAYS( NOW( ) ) - TO_DAYS( create_date ) = 1 <#else>\r\n            TO_DAYS( \'${day}\' ) = TO_DAYS( create_date ) </#if>\r\n                <#else>\r\n            TO_DAYS( NOW( ) ) = TO_DAYS( create_date ) </#if>\r\n\r\n            GROUP BY\r\n            `cookie`\r\n            ) AS cookie\r\n    ) t2 ON t2.HOUR = t1.HOUR\r\nGROUP BY\r\n    t1.`HOUR`;','system',null,'网站每小时访客数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- time: 指定日期,格式 : yyyy-MM-dd --> <#-- days: 天数 格式:整数 -->\r\nSELECT\r\n    t1.`day` AS `day`,\r\n    COUNT( t2.id ) AS num\r\nFROM\r\n    (\r\n        SELECT\r\n            @cdate := DATE_ADD( @cdate, INTERVAL - 1 DAY ) DAY\r\n        FROM\r\n            ( SELECT @cdate := DATE_ADD( \'${time}\', INTERVAL + 1 DAY ) FROM `access_statistics` ) t0\r\n            LIMIT ${days}) t1\r\n        LEFT JOIN (\r\n        SELECT\r\n            *,\r\n            DATE_FORMAT( create_date, \"%Y-%m-%d\" ) AS DAY\r\n        FROM\r\n            (\r\n            SELECT\r\n            any_value(id) id, any_value(create_date) create_date\r\n            FROM\r\n            `access_statistics`\r\n            WHERE\r\n            create_date > DATE_ADD( \'${time}\', INTERVAL - ${days} DAY )\r\n            AND create_date < DATE_ADD( \'${time}\', INTERVAL + 1 DAY )\r\n            GROUP BY\r\n            DATE_FORMAT( create_date, \"%Y-%m-%d\" ),`cookie`\r\n            ) AS cookie\r\n    ) t2 ON t2.DAY = t1.DAY\r\nGROUP BY\r\n    t1.`day`;','system',null,'指定时间前N天内每天访客数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: today为今天数据,yesterday为昨天数据,不传为总数据 -->\r\nSELECT\r\n	COUNT( 0 ) AS num \r\nFROM\r\n	( SELECT COUNT( 0 ) FROM `access_statistics`\r\n		<#if day??>\r\n			<#if day==\'today\'>\r\n			WHERE TO_DAYS( NOW( ) ) = TO_DAYS(create_date)\r\n			<#elseif day==\'yesterday\'>\r\n			WHERE TO_DAYS( NOW( ) ) - TO_DAYS(create_date) = 1\r\n			</#if>\r\n		</#if>\r\n	 GROUP BY `IP` ) AS ip','system',null,'网站IP数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- day: today为今天数据,yesterday为昨天数据,不传为总数据 -->\r\nSELECT COUNT(0) as \'newContent\' FROM `cms_content` \r\n<#if day??>\r\n	<#if day==\'today\'>\r\n	WHERE TO_DAYS( NOW( ) ) = TO_DAYS(create_date)\r\n	<#elseif day==\'yesterday\'>\r\n	WHERE TO_DAYS( NOW( ) ) - TO_DAYS(create_date) = 1\r\n	</#if>\r\n</#if>','system',null,'网站文章数',0 );
INSERT INTO `statistics_sql` ( `ss_sql`,`ss_type`,`ss_key`,`ss_name`,`del` ) VALUES  ( '<#-- startTime: 开始日期 --> \r\n<#-- endTime: 结束日期 --> \r\n<#-- 格式 : yyyy-MM-dd HH:mm:ss --> \r\n<#-- 不传则获取当天 --> \r\nSELECT\r\n	url,\r\n	COUNT( 0 ) AS pv,\r\n	CAST(\r\n	AVG( ACCESS_TIME ) AS DECIMAL ( 10, 2 )) AS TIME \r\nFROM\r\n	`access_statistics` \r\nWHERE\r\n	<#if startTime?? && endTime??>\r\n	create_date > \'${startTime}\' \r\n	AND create_date < \'${endTime}\' \r\n	<#else>\r\n	TO_DAYS( NOW( ) ) = TO_DAYS( create_date ) \r\n	</#if>\r\nGROUP BY\r\n	url \r\nORDER BY\r\n	pv DESC \r\n	LIMIT 0,10','system',null,'获取指定范围访问量前十的页面',0 );
